import { singleBlog } from "../../actions/blog";
import { API, DOMAIN, APP_NAME } from "../../config";


const SingleBlog =({router})=>{



    return(
        <React.Fragment>
            <Layout>
                <main>
                    <article>
                        <div className="container-fluid">
                            <section>
                                {JSON.stringify(router)}
                            </section>
                        </div>
                    </article>
                </main>
            </Layout>
        </React.Fragment>
    )


}

export default withRouter(SingleBlog)
